import React, { useState, useEffect } from 'react'
import { Card } from 'antd';
import axios from "axios"
import { Carousel } from 'antd';
import img1 from "../Images/7041856-walter-white.jpg"
import img2 from "../Images/7041798.jpg"
import img3 from "../Images/7038019-the-witcher-3-wild-hunt.jpg"
import img4 from "../Images/7037036-time-of-the-doctor.jpg"
import "./CSS/Home.css"

const { Meta } = Card;

function Home() {
  const [list, setList] = useState([])

  useEffect(() => {
    axios.get('/api/movies').then((res) => {
      setList(res.data)
      console.log(list)
    })
  }, [])


  return (
    <div>
      <Carousel autoplay className='Carousel'>
        <div  >
          <img className='img1' src={img1} alt="" />
        </div>
        <div>
          <img className='img1' src={img2} alt="" />
        </div>
        <div>
          <img className='img1' src={img3} alt="" />
        </div>
        <div>
          <img className='img1' src={img4} alt="" />
        </div>
      </Carousel>




      <div className='Card'>
        {list.map((data) => {
          return (
            <Card
              className='card1'
              hoverable
              cover={<img className='cardimage' alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
            ><div> <Meta title={data.moviename} description={data.release}  />
            
            {data.rating}
            </div>
             
            </Card>
          )
        })}
      </div>

    </div>
  )
}

export default Home
